Information
------------------------------

Mortality and death have always fascinated humankind. Civilizations from all over the world have practiced mummification as a means of preserving life after death--a ritual which captures the imagination of scientists, artists, and public alike. 
For nearly everyone the words &quot;pyramids&quot; and &quot;mummies&quot; evoke images of ancient Egypt. Yet those intriguing cultural artifacts are by no means unique to the Land of the Pharoahs. As this collection vividly demonstrates, they are found around the world, including the Americas. Indeed, the oldest mummies in the world, and some of the most sophisticated anywhere, come not from the Nile Valley but from the Atacama Desert in Chile. Mummies have always been with us, and today we turn to them with ever more advanced and refined methods and learning their deep secrets.

3)  Mummies that Made Themselves 
Travel to the remote mountains of Northern Japan to learn how Shingon Buddhist monks mummified their own bodies.
Hidden in the mountains of Japan are unique holy relics; the mummified remains of Buddhist monks who died over 200 years ago. These are no ordinary mummies, but the bodies of monks who underwent a process of self-mummification while still alive. How exactly such total mummification was achieved has remained a mystery, but now a team of Japanese scientists believe they may have the answer. Using a series of scientific investigations, Mummies That Made Themselves sets out to discover just how this startling process was possible, and attempts to unravel the mysteries behind the monks' perfect mummification.

